import "./App.css";
import Container from "./Container/Container";
 import {Switch, Route} from "react-router-dom";
 import Signup from "./Component/Signup";

function App() {
  return (
    <div>
    {/*<Container/>*/}
       <Switch>
        <Route path='/' component={Container} />
        <Route path='/signup' component={Signup}/>
      </Switch>   
    </div>
  );
}

export default App;
